import React from 'react';
import Completed from '../../assets/images/completed.svg';
import Current from '../../assets/images/current-level.svg';
import Locked from '../../assets/images/locked.svg';

function LevelItem({ completed, current, locked }) {
    const classes = `level-path-btn mx-2 ${
        completed ? 'completed' : current ? 'current ring-4 ring-offset-4 ring-gray-400' : 'locked'
    }`;

    return (
        <li className="mt-5">
            <a href='play.html' className={classes}>
                <img src={completed ? Completed : current ? Current : Locked} className='size-14 '/>
            </a>
            <span className='mt-2 font-semibold'>Select</span>
        </li>
    );
}

export default LevelItem;
